import React from 'react';

const Contact = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh'
      }}
    >
      <div></div>
      <h4>Để lại tin nhắn cho chúng tôi </h4>

    </div>
  );
};

export default Contact;
